import React, { useState, useEffect, useContext } from 'react';
import { NavLink } from 'react-router-dom';
import { AdminContext } from '../../App';

const Logstats = () => {
    const { adminState, dispatchadmin } = useContext(AdminContext);
    const [getUsers, setGetUsers] = useState([]);

    const getallusers = async () => {
        try {
            const res = await fetch('/getavailableusers', {
                method: 'GET',
            });

            const data = await res.json();
            setGetUsers(data);

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getallusers();
    }, []);

    let userIdFromDashBoard;
    const deleteUser = (e) => {
        userIdFromDashBoard = e.target.id;
        return fetch("/deleteUserfromdashboard", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                userIdFromDashBoard
            })
        });
    }

    const Loginbutton = () => {
        if (adminState) {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/adminsignout">
                            logout
                        </NavLink>
                    </button>
                </div>
            );
        } else {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/signin">
                            login
                        </NavLink>
                    </button>
                </div>
            );
        }
    }

    return (
        <>
            <div className="sidebar">
                {/* Sidebar content */}
            </div>

            <section className="home-section">
                {/* Section content */}
                <div className="salecartableDiv">
                    <h1 className="heading">
                        <span>Available Users</span>
                    </h1>

                    <table className="salecartable">
                        <thead>
                            <tr>
                                <th>NAME</th>
                                <th>EMAIL</th>
                                <th>PHONE</th>
                                <th>TOKENS</th> {/* New column for tokens */}
                                <th>DELETE</th>
                            </tr>
                        </thead>
                        <tbody>
                            {getUsers.map((user) => (
                                <tr key={user._id}>
                                    <td>{user.name}</td>
                                    <td>{user.email}</td>
                                    <td>{user.phone}</td>
                                    <td>{user.tokens.length}</td> {/* Display the length of tokens array */}
                                    <td>
                                        <button
                                            id={user._id}
                                            onClick={deleteUser}
                                            className="btn"
                                        >
                                            <i className="fa fa-trash"></i>
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </section>
        </>
    );
}

export default Logstats;
